import React from "react";
import "./Orders.css";
import { Link } from "react-router-dom";
axios.get("http://localhost:8080/api/orders")


const sampleOrders = [
  {
    id: "ORD1001",
    customer: "Amit Patel",
    date: "2025-06-27",
    total: "₹1,250",
    status: "Pending",
  },
  {
    id: "ORD1002",
    customer: "Priya Sharma",
    date: "2025-06-26",
    total: "₹2,800",
    status: "Shipped",
  },
  {
    id: "ORD1003",
    customer: "Rahul Verma",
    date: "2025-06-25",
    total: "₹950",
    status: "Delivered",
  },
  {
    id: "ORD1004",
    customer: "Neha Desai",
    date: "2025-06-24",
    total: "₹3,400",
    status: "Cancelled",
  },
];

function Orders() {
  return (
    <div className="page">
      <h2>Orders</h2>
      <Link to="/orders/new">
        <button style={{ marginBottom: "15px" }}>➕ New Order</button>
      </Link>
      <table className="order-table">
        <thead>
          <tr>
            <th>Order ID</th>
            <th>Customer</th>
            <th>Date</th>
            <th>Total</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {sampleOrders.map((order) => (
            <tr key={order.id}>
              <td>{order.id}</td>
              <td>{order.customer}</td>
              <td>{order.date}</td>
              <td>{order.total}</td>
              <td>
                <span className={`status ${order.status.toLowerCase()}`}>
                  {order.status}
                </span>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Orders;
